import React, { useEffect, useState } from 'react';
import '../app3.css';

const CourseList = () => {
    const [courses, setCourses] = useState([]);

    useEffect(() => {
        fetch('http://localhost:5000/api/courses-admin')
            .then(res => res.json())
            .then(data => setCourses(data))
            .catch(err => console.error(err));
    }, []);

    const handleSubmit = (event) => {
        event.preventDefault();

        const formData = new FormData(event.target);
        const updatedCourses = courses.map(course => ({
            ...course,
            status: formData.get(`status-${course.id}`),
        }));
        alert('do you want to continue?');
        fetch('http://localhost:5000/api/courses-admin', {
            method: 'POST',
            headers: {
                'Content-Type': 'application/json',
            },
            body: JSON.stringify(updatedCourses),
        })
        .then(res => res.text())
        .then(data => {
            setCourses(updatedCourses);
            alert(data);
        })
        .catch(err => console.error(err));
    };

    return (
        <form onSubmit={handleSubmit}>
        <div classNamw='content'>
        <div className='left-columnt'>
        	<h3>Verified<br></br></h3>
            {courses.map(course => course.status==='verified' && (
                <div key={course.id} className="course-card">
                    <p><b>{course.title}</b></p><br></br>
                    <p><b>{course.branch}</b></p><br></br>
                    <p><b>{course.college}</b></p><br></br>
                    <p>{course.description}</p>
                    <label>
                        <input
                            type="radio"
                            name={`status-${course.id}`}
                            value="verified"
                            defaultChecked={course.status === 'verified'}
                        />
                        Verified
                    </label>
                    <label>
                        <input
                            type="radio"
                            name={`status-${course.id}`}
                            value="unverified"
                            defaultChecked={course.status === 'unverified'}
                        />
                        Unverified
                    </label>
                </div>
            ))}
            </div>
            <div className='right-columnt'>
            <h3>Unverified<br></br></h3>
            {courses.map(course => course.status==='unverified' && (
                <div key={course.id} className="course-card">
                    <p><b>{course.title}</b></p><br></br>
                    <p><b>{course.branch}</b></p><br></br>
                    <p><b>{course.college}</b></p><br></br>
                    <p>{course.description}</p>
                    <label>
                        <input
                            type="radio"
                            name={`status-${course.id}`}
                            value="verified"
                            defaultChecked={course.status === 'verified'}
                        />
                        Verified
                    </label>
                    <label>
                        <input
                            type="radio"
                            name={`status-${course.id}`}
                            value="unverified"
                            defaultChecked={course.status === 'unverified'}
                        />
                        Unverified
                    </label>
                </div>
            ))}
            </div>
            </div>
            <button type="submit" id="fixed">Submit</button>
        </form>
    );
};

export default CourseList;
